import React from "react";
import { NavLink } from "react-router-dom";


const Navbar = ()=>{
return (
    <>
    <Link to ='/'>About Us</Link>
    <br/>
    <Link to ='/contact'>Contact Us</Link>
    </>
)
}

export default Navbar;
